import React from 'react';
import "./Nav.css";

function Nav() {
  return (
    <div className="nav">
        <div>
            <img className='nav_image' src="https://avatars.githubusercontent.com/u/73348574?s=60&v=4"/>
        </div>
        <div>
            <p className='app_name'>Know Each</p>
        </div>
        <div>
            <p className='contact'>Contact Admin</p>
        </div>
    </div>
  );
}

export default Nav;
